import classes from './MerchSummary.module.css';

const MerchSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Set your heart ablaze with our merch!</h2>
      <p>
        Get merch based on your favourite characters of demon slayer, to watch along with!
      </p>
      <p>
        Our Merch are of great quality, and shipped out ASAP!
      </p>
    </section>
  );
};

export default MerchSummary;
